import React, { useState } from 'react';
import { View, Text, TouchableOpacity, StyleSheet, Dimensions } from 'react-native';
import { colors } from '../../utils/colors';

export default function Navbar() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const windowWidth = Dimensions.get('window').width;
  const isMobile = windowWidth < 768;

  const handleGetStarted = () => {
    // Scroll to chat section
    const chatSection = document.querySelector('#chat-section');
    if (chatSection) {
      chatSection.scrollIntoView({ behavior: 'smooth' });
    }
    setIsMenuOpen(false);
  };

  const handleAbout = () => {
    // Scroll to about section
    const aboutSection = document.querySelector('#about-section');
    if (aboutSection) {
      aboutSection.scrollIntoView({ behavior: 'smooth' });
    }
    setIsMenuOpen(false);
  };

  const handleFeatures = () => {
    // Scroll to features section
    const featuresSection = document.querySelector('#features-section');
    if (featuresSection) {
      featuresSection.scrollIntoView({ behavior: 'smooth' });
    }
    setIsMenuOpen(false);
  };

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <View style={styles.navbar}>
      <View style={styles.leftSection}>
        <TouchableOpacity 
          style={styles.logoContainer}
          onPress={() => window.scrollTo({ top: 0, behavior: 'smooth' })}
        >
          <Text style={styles.logo}>HustleBot</Text>
        </TouchableOpacity>
      </View>

      {isMobile && (
        <TouchableOpacity 
          style={styles.menuButton} 
          onPress={toggleMenu}
        >
          <Text style={styles.menuIcon}>
            {isMenuOpen ? '✕' : '☰'}
          </Text>
        </TouchableOpacity>
      )}

      <View style={[
        styles.rightSection,
        isMobile && styles.mobileRightSection,
        isMobile && !isMenuOpen && styles.hiddenMobile
      ]}>
        <TouchableOpacity 
          style={[styles.navLink, styles.navLinkHover]}
          onPress={handleAbout}
        >
          <Text style={styles.navLinkText}>About</Text>
        </TouchableOpacity>
        <TouchableOpacity 
          style={[styles.navLink, styles.navLinkHover]}
          onPress={handleFeatures}
        >
          <Text style={styles.navLinkText}>Features</Text>
        </TouchableOpacity>
        <TouchableOpacity 
          style={[styles.navLink, styles.primaryButton, styles.primaryButtonHover]}
          onPress={handleGetStarted}
        >
          <Text style={styles.primaryButtonText}>Get Started</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  navbar: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: 16,
    backgroundColor: colors.background.primary,
    borderBottomWidth: 1,
    borderBottomColor: colors.background.tertiary,
    height: 64,
    position: 'fixed',
    top: 0,
    left: 0,
    right: 0,
    zIndex: 999,
    '@media (max-width: 768px)': {
      padding: 12
    }
  },
  leftSection: {
    flexDirection: 'row',
    alignItems: 'center'
  },
  logoContainer: {
    marginRight: 24,
    cursor: 'pointer',
    transition: 'opacity 0.2s ease'
  },
  logo: {
    fontSize: 24,
    fontWeight: 'bold',
    color: colors.primary,
    '@media (max-width: 768px)': {
      fontSize: 20
    }
  },
  rightSection: {
    flexDirection: 'row',
    alignItems: 'center',
    gap: 24,
    '@media (max-width: 768px)': {
      gap: 16
    }
  },
  mobileRightSection: {
    position: 'absolute',
    top: 64,
    left: 0,
    right: 0,
    backgroundColor: colors.background.primary,
    flexDirection: 'column',
    padding: 16,
    borderBottomWidth: 1,
    borderBottomColor: colors.background.tertiary,
    gap: 16,
    transition: 'transform 0.3s ease'
  },
  hiddenMobile: {
    transform: [{ translateY: '-100%' }],
    pointerEvents: 'none',
    opacity: 0
  },
  navLink: {
    paddingVertical: 8,
    paddingHorizontal: 12,
    borderRadius: 6,
    cursor: 'pointer',
    transition: 'all 0.2s ease',
    '@media (max-width: 768px)': {
      width: '100%',
      textAlign: 'center'
    }
  },
  navLinkHover: {
    ':hover': {
      backgroundColor: colors.background.secondary
    }
  },
  navLinkText: {
    fontSize: 16,
    color: colors.text.primary,
    fontWeight: '500',
    '@media (max-width: 768px)': {
      fontSize: 14
    }
  },
  primaryButton: {
    backgroundColor: colors.primary,
    borderRadius: 8,
    paddingVertical: 8,
    paddingHorizontal: 16,
    transition: 'all 0.2s ease'
  },
  primaryButtonHover: {
    ':hover': {
      backgroundColor: `${colors.primary}E6`,
      transform: [{ scale: 1.05 }]
    }
  },
  primaryButtonText: {
    color: colors.text.inverse,
    fontWeight: 'bold',
    fontSize: 16,
    '@media (max-width: 768px)': {
      fontSize: 14
    }
  },
  menuButton: {
    padding: 8,
    cursor: 'pointer'
  },
  menuIcon: {
    color: colors.text.primary,
    fontSize: 24
  }
});
